import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { fetch20Pokemons } from "./components/store/pokemon-actions";
import "./App.css";

function App() {
  const dispatch = useDispatch();
  const pokemons = useSelector((state) => state.pokemonAddSlice.pokemonList);
  useEffect(() => {
    dispatch(fetch20Pokemons());
  }, [dispatch]);

  return <div onClick={() => console.log(pokemons)}>chuj </div>;
}

export default App;
